description:
She's Out of My League (2010) 

Verenigde Staten
Komedie / Romantiek
104 minuten

geregisseerd door Jim Field Smith
met Jay Baruchel, Mike Vogel en Alice Eve

Kirk (Jay Baruchel), een normale jongen, ontmoet de perfecte 
vrouw en tegen alle verwachtingen in, valt ze ook nog voor hem. 
Kirk is in de zevende hemel, maar zijn gebrek aan zelfvertrouwen 
en zijn vrienden en familie die niet met de relatie meewerken, 
zijn storende factoren die een gevaar zijn voor Kirk's ''droom''.

